import React from 'react';
//import './App.css';
import Container from 'react-bootstrap/Container'
import Table from 'react-bootstrap/Table'

import axios from 'axios';

let one = "http://api.waqi.info/feed/stockholm/?token=6460bc98321176676eee4a2d07153eb8854628fe"
let two = "http://api.waqi.info/feed/göteborg/?token=6460bc98321176676eee4a2d07153eb8854628fe"

const requestOne = axios.get(one);
const requestTwo = axios.get(two);

var obj;
var response;

var city;
var name;

var forecast;
var daily;
var pm25;
var today

var avg;
var day;
var max;
var min;

var elements;

export default class Experiment3 extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.all([requestOne])
      .then(res => {
        obj = res[0].data;

        function myFunction(x) {
            response = x[Object.keys(x)[1]];

            city = response[Object.keys(response)[3]];
            name = city[Object.keys(city)[1]];

            forecast = response[Object.keys(response)[7]];
            daily = forecast[Object.keys(forecast)[0]];
            pm25 = daily[Object.keys(daily)[2]];
            today = pm25[Object.keys(pm25)[2]];

            avg = today[Object.keys(today)[0]];
            day = today[Object.keys(today)[1]];
            max = today[Object.keys(today)[2]];
            min = today[Object.keys(today)[3]];

            return elements = {name: name, avg: avg, day: day, max: max, min: min};
          }


         myFunction(obj);

        const persons = elements;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <Container>
<Table striped bordered hover size="sm">
<thead>
  <tr>
    <th>Stad</th>
    <th>Genomsnitt</th>
    <th>Datum</th>
    <th>Dagens Max</th>
    <th>Dagens Min</th>
  </tr>
  </thead>
  <tbody>
  <tr>
    <td>{ this.state.persons.name}</td>
    <td>{ this.state.persons.avg}</td>
    <td>{ this.state.persons.day}</td>
    <td>{ this.state.persons.max}</td>
    <td>{ this.state.persons.min}</td>
  </tr>
  </tbody>
</Table>
</Container>
    )
  }
}
